window.bookSummaryJSON = "<p>His name is Taylor McFadden, survivor of 83 trips into the ZOO. Now, he's retired, and yet his country needs his skills to save people in the country he calls home. Can he build a company, put down roots, and still bring the pain when the FBI calls?&nbsp;&nbsp;</p> <p>When they tag him as The Cryptid Assassin, they weren't wrong. For monsters that go bump in the night, he is death incarnate.</p>"; 
